INSERT INTO `product` (`id`, `title`, `price`, `description`, `gender`, `category_id`, `main_photo1_id`, `main_photo2_id`, `booking_id`, `discr`, `SleeveLength`, `Filling`, `OuterMaterial`, `Seasonality`, `Composition`, `Waist`, `Length`, `brand_id`) VALUES
	(118, 'курточка', 34, 'теплая очень', 'female', 1, 16, 17, 1, 'jacket', 48, 'пушок', 'nice', 'north', NULL, NULL, NULL, 9),
	(120, 'штанишки', 9, 'As of v3.1.0, we\'ve deprecated .pull-right on dropdown menus. To right-align a menu, use .dropdown-menu-right. Right-aligned nav components in the navbar use a mixin version of this class to automatically align the menu. To override it, use .dropdown-menu-left.', 'female', 3, 21, 22, NULL, 'trousers', NULL, NULL, NULL, NULL, NULL, 62, 88, 4),
	(122, 'кофта теплая', 7, 'Doctrine allows you to work with databases in a much more interesting way than just fetching rows of scalar data into an array. Instead, Doctrine allows you to fetch entire objects out of the database, and to persist entire objects to the database. For Doctrine to be able to do this, you must map your database tables to specific PHP classes, and the columns on those tables must be mapped to specific properties on their corresponding PHP classes.', 'female', 2, 27, 28, 3, 'sweater', 50, NULL, NULL, NULL, 'шерстяной', NULL, NULL, 9),
	(123, 'блузка', 4.5, 'Be careful if the names of your entity classes (or their properties) are also reserved SQL keywords like GROUP or USER. For example, if your entity\'s class name is Group, then, by default, the corresponding table name would be group. This will cause an SQL error in some database engines. See Doctrine\'s Reserved SQL keywords documentation for details on how to properly escape these names. Alternatively, if you\'re free to choose your database schema, simply map to a different table name or column name. See Doctrine\'s Creating Classes for the Database and Property Mapping documentation.', 'female', 4, 29, 30, NULL, 'blouse', 45, NULL, NULL, NULL, 'cotton', NULL, NULL, 6),
	(124, 'джинсы', 6, 'The Form component comes with tight (but optional) integration with Symfony\'s Validator component. If you\'re using a different solution for validation, no problem! Simply take the submitted/bound data of your form (which is an array or object) and pass it through your own validation system.', 'female', 9, 32, 33, NULL, 'trousers', NULL, NULL, NULL, NULL, NULL, 63, 97, 10),
	(125, 'test', 11, 'Twig can also do things that PHP can\'t, such as whitespace control, sandboxing, automatic HTML escaping, manual contextual output escaping, and the inclusion of custom functions and filters that only affect templates. Twig contains little features that make writing templates easier and more concise. Take the following example, which combines a loop with a logical if statement:', 'female', 4, 35, 36, 1, 'blouse', 50, NULL, NULL, NULL, 'cotton', NULL, NULL, 2),
